'use strict';(function(){const indexCfg={cache:true};indexCfg.doc={id:'id',field:['title','content'],store:['title','href'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/docs/scala/','title':"Scala",'content':"Scala 特徴  オブジェクト指向プログラミングと関数型プログラミングの両方ができる特徴を持ったプログラミング言語． 非同期プログラミング，並行・並列処理を得意とする． Java Virtual Machine (JVM) 上で動く． 2003 年に スイス連邦工科大学の Martin Odersky 教授によって開発されたプログラミング言語． GitHub: scala/scala WebSite: https://scala-lang.org  解説ページ   日本の Scala コミュニティによる解説ページ  N 予備校による解説ページ  "});index.add({'id':1,'href':'/docs/scala/sbt/','title':"sbt",'content':"sbt 概要  Scala の標準的なビルドツール． GitHub: sbt/sbt WebSite: https://www.scala-sbt.org/ Docs-en: https://www.scala-sbt.org/1.x/docs/ Docs-ja: https://www.scala-sbt.org/release/docs/ja/index.html  Docker で使う  GitHub: hseeberger/scala-sbt GitHub: mozilla/docker-sbt  image を build する docker build \\  --build-arg BASE_IMAGE_TAG=\u0026#34;8u212-b04-jdk-stretch\u0026#34; \\  --build-arg SBT_VERSION=\u0026#34;1.3.8\u0026#34; \\  --build-arg SCALA_VERSION=\u0026#34;2.13.1\u0026#34; \\  --build-arg USER_ID=1001 \\  --build-arg GROUP_ID=1001 \\  -t solareenlo/scala-sbt \\  github.com/hseeberger/scala-sbt.git#:debian docker run # コンテナを走らせる sudo docker run -it --rm -v $(pwd):/root solareenlo/scala-sbt:latest bash sudo docker run -it --rm -v $(pwd):/root solareenlo/scala-sbt:latest scala sudo docker run -it --rm -v $(pwd):/root solareenlo/scala-sbt:latest sbt 使い方 sbt runMain TestStudy or\nsbt run or\nsbt console 設定ファイル touch build.sbt # build.sbt scalaVersion := \u0026#34;2.13.1\u0026#34; scalacOptions ++= Seq(\u0026#34;-deprecation\u0026#34;, \u0026#34;-feature\u0026#34;, \u0026#34;-unchecked\u0026#34;, \u0026#34;-Xlint\u0026#34;) 上記のオプションを付けることで以下の警告の情報を出してくれるようになる．\n -deprecation: 今後廃止の予定のAPIを利用している -feature: 明示的に使用を宣言しないといけない実験的な機能や注意しなければならない機能を利用している -unchecked: 型消去などでパターンマッチが有効に機能しない場合 -Xlint: その他，望ましい書き方や落とし穴についての情報  "});index.add({'id':2,'href':'/docs/scala/class/','title':"class",'content':"class 記法  ` ` \u0026hellip; アルファベットや記号の並び ( ) \u0026hellip; グルーピング \u0026lt; \u0026gt; \u0026hellip; 何らかの構文要素 * \u0026hellip; その要素が0回以上現れる + \u0026hellip; その要素が1回以上現れる ? \u0026hellip; その要素が0回または1回現れる A | B \u0026hellip; A と B のどちらでも良い ... \u0026hellip; 同じパターンで出現する  定義 class \u0026lt;クラス名\u0026gt; \u0026#39;(\u0026#39; (\u0026lt;引数名1\u0026gt; : \u0026lt;引数型1\u0026gt;, \u0026lt;引数名2\u0026gt;: \u0026lt;引数型2\u0026gt; ...)? \u0026#39;)\u0026#39; { (\u0026lt;フィールド定義\u0026gt; | \u0026lt;メソッド定義\u0026gt; )* } "});index.add({'id':3,'href':'/docs/','title':"Docs",'content':""});})();